import React from 'react';
import Story from "./Story";

import './Stories.css';

const COLUMNS = {
    title: {
        width: '40%',
        label: 'Title'
    },
    author: {
        width: '30%',
        label: 'Author'
    },
    commnets: {
        width: '10%',
        label: 'Commnets'
    },
    points: {
        width: '10%',
        label: 'Points'
    },
    archive: {
        width: '10%',
    }
};

const Stories = ({ stories }) => {
    return (
        <div className="stories">
            {stories.map(story => (
                <Story
                    key={story.objectID}
                    story={story}
                />
            ))}
        </div>
    );
}

export default Stories;
